"use strict";(self.webpackChunkatlas=self.webpackChunkatlas||[]).push([[7883],{8520:(e,t,n)=>{n.r(t),n.d(t,{assets:()=>l,contentTitle:()=>c,default:()=>p,frontMatter:()=>o,metadata:()=>i,toc:()=>d});const i=JSON.parse('{"id":"chapters/04/4","title":"Implementation","description":"AI Safety Standards","source":"@site/docs/chapters/04/04.md","sourceDirName":"chapters/04","slug":"/chapters/04/04","permalink":"/chapters/04/04","draft":false,"unlisted":false,"editUrl":"https://github.com/markov-root/atlas/edit/main/docs/chapters/04/04.md","tags":[],"version":"current","sidebarPosition":5,"frontMatter":{"id":"4","title":"Implementation","sidebar_label":"4.4 Implementation","sidebar_position":5,"slug":"/chapters/04/04","reading_time_core":"11 min","reading_time_optional":"1 min","pagination_prev":"chapters/04/3","pagination_next":"chapters/04/5"},"sidebar":"docs","previous":{"title":"4.3 Governance Architectures","permalink":"/chapters/04/03"},"next":{"title":"4.5 Conclusion","permalink":"/chapters/04/05"}}');var a=n(4848),s=n(8453),r=(n(2482),n(8559),n(1966),n(2501));const o={id:4,title:"Implementation",sidebar_label:"4.4 Implementation",sidebar_position:5,slug:"/chapters/04/04",reading_time_core:"11 min",reading_time_optional:"1 min",pagination_prev:"chapters/04/3",pagination_next:"chapters/04/5"},c="Implementation",l={},d=[{value:"AI Safety Standards",id:"01",level:2},{value:"Regulatory Visibility",id:"02",level:2},{value:"Ensuring Compliance",id:"03",level:2},{value:"Limitations and Trade-Offs",id:"04",level:2}];function h(e){const t={a:"a",h1:"h1",h2:"h2",header:"header",li:"li",p:"p",strong:"strong",ul:"ul",...(0,s.R)(),...e.components},{GlossaryTerm:n}=t;return n||function(e,t){throw new Error("Expected "+(t?"component":"object")+" `"+e+"` to be defined: you likely forgot to import, pass, or provide it.")}("GlossaryTerm",!0),(0,a.jsxs)(a.Fragment,{children:[(0,a.jsx)(t.header,{children:(0,a.jsx)(t.h1,{id:"implementation",children:"Implementation"})}),"\n",(0,a.jsx)(t.h2,{id:"01",children:"AI Safety Standards"}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.strong,{children:"What approaches exist for developing AI safety standards at the national level?"})," Various approaches to developing safety standards exist within national contexts, from government-led standardization bodies to public-private collaborative processes. National standards bodies play a critical role in developing and implementing AI safety standards that align with each country's policy priorities and technological capabilities (",(0,a.jsx)(t.a,{href:"https://www.governance.ai/research-paper/standards-for-ai-governance-international-standards-to-enable-global-coordination-in-ai-research-development",children:"Cihon, 2019"}),"). The EU AI Act demonstrates this through its requirement for a Code of Practice that specifies high-level obligations for General-Purpose AI models. In the United States, the National Institute of Standards and Technology (NIST) has developed an AI Risk Management Framework that serves as a voluntary standard within American jurisdiction. In 2021, the Standardization Administration of China (SAC) released a roadmap for AI standards development that includes over 100 technical and ethical specifications from algorithmic transparency to biometric recognition safety. Coordinated by government agencies such as the Ministry of Industry and Information Technology (MIIT) and the China Electronics Standardization Institute (CESI). Unlike in the US or EU, where standards are often multistakeholder-developed or market-driven, China\u2019s process is highly centralized and closely linked to its broader geopolitical ambitions (",(0,a.jsx)(t.a,{href:"https://www.fhi.ox.ac.uk/wp-content/uploads/Deciphering_Chinas_AI-Dream.pdf",children:"Ding, 2018"}),")."]}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.strong,{children:"How do national standards bodies develop effective AI safety standards?"})," National standards have experience in governing various socio-technical issues within their countries. For example, national cybersecurity standards have spread across industries, environmental sustainability standards have prompted significant corporate investments, and safety standards have been implemented across sectors from automotive to energy. Expertise from other high-stakes industries can be leveraged to develop effective AI safety standards tailored to a country's specific needs and regulatory environment (",(0,a.jsx)(t.a,{href:"https://www.governance.ai/research-paper/standards-for-ai-governance-international-standards-to-enable-global-coordination-in-ai-research-development",children:"Cihon, 2019"}),"). National standards can be used to spread a culture of safety and responsibility in AI research and development in four ways:"]}),"\n",(0,a.jsxs)(t.ul,{children:["\n",(0,a.jsxs)(t.li,{children:["\n",(0,a.jsx)(t.p,{children:"The criteria within standards establish rules and expectations for safety practices within the country's AI ecosystem."}),"\n"]}),"\n",(0,a.jsxs)(t.li,{children:["\n",(0,a.jsx)(t.p,{children:"Standards embed individual researchers and organizations within a larger network of domestic accountability."}),"\n"]}),"\n",(0,a.jsxs)(t.li,{children:["\n",(0,a.jsx)(t.p,{children:"Regular implementation of standards helps researchers internalize safety routines as part of standard practice."}),"\n"]}),"\n",(0,a.jsxs)(t.li,{children:["\n",(0,a.jsx)(t.p,{children:"When standards are embedded in products and software packages, they reinforce safety considerations regardless of which domestic organizations use the system."}),"\n"]}),"\n"]}),"\n",(0,a.jsxs)(t.p,{children:['These mechanisms help create what some researchers have called a "safety mindset" among AI practitioners within the national AI ecosystem. National standards serve as effective tools for fostering a culture of responsibility and safety in AI development, which is essential for long-term societal benefit (',(0,a.jsx)(t.a,{href:"https://www.governance.ai/research-paper/standards-for-ai-governance-international-standards-to-enable-global-coordination-in-ai-research-development",children:"Cihon, 2019"}),")."]}),"\n",(0,a.jsx)(t.h2,{id:"02",children:"Regulatory Visibility"}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.strong,{children:"Regulatory visibility requires active, independent scrutiny of AI systems before, during, and after deployment."})," As frontier AI systems become increasingly integrated into society, external scrutiny (involving outside actors in the evaluation of AI systems) offers a powerful tool for enhancing safety and accountability. Effective external scrutiny should adhere to the ASPIRE framework, which proposes six criteria for effective external evaluation (",(0,a.jsx)(t.a,{href:"https://arxiv.org/abs/2311.14711",children:"Anderljung et al., 2023"}),"):"]}),"\n",(0,a.jsxs)(t.ul,{children:["\n",(0,a.jsxs)(t.li,{children:["\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.strong,{children:"Access:"})," External scrutineers need appropriate access to AI systems and relevant information."]}),"\n"]}),"\n",(0,a.jsxs)(t.li,{children:["\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.strong,{children:"Searching attitude:"})," Scrutineers should actively seek out potential issues and vulnerabilities."]}),"\n"]}),"\n",(0,a.jsxs)(t.li,{children:["\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.strong,{children:"Proportionality to the risks:"})," The level of scrutiny should match the potential risks posed by the system."]}),"\n"]}),"\n",(0,a.jsxs)(t.li,{children:["\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.strong,{children:"Independence:"})," Scrutineers should be free from undue influence from AI developers."]}),"\n"]}),"\n",(0,a.jsxs)(t.li,{children:["\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.strong,{children:"Resources:"})," Adequate resources must support thorough scrutiny."]}),"\n"]}),"\n",(0,a.jsxs)(t.li,{children:["\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.strong,{children:"Expertise:"})," Scrutineers must possess the necessary technical and domain-specific expertise."]}),"\n"]}),"\n"]}),"\n",(0,a.jsxs)(t.p,{children:["Some countries are exploring model registries, which are centralized databases that include architectural details, training procedures, performance metrics, and societal impact assessments. These registries support structured oversight and can act as early-warning systems for emerging capabilities, helping regulators detect dangerous trends before they materialize as harms (",(0,a.jsx)(t.a,{href:"https://www.convergenceanalysis.org/research/ai-model-registries-a-foundational-tool-for-ai-governance",children:"McKernon et al., 2024"}),"). Different jurisdictions take different approaches, but model documentation typically encompasses:"]}),"\n",(0,a.jsxs)(t.ul,{children:["\n",(0,a.jsxs)(t.li,{children:["\n",(0,a.jsx)(t.p,{children:"Basic documentation (model identification, intended use cases)"}),"\n"]}),"\n",(0,a.jsxs)(t.li,{children:["\n",(0,a.jsx)(t.p,{children:"Technical specification (architecture, parameters, computational requirements)"}),"\n"]}),"\n",(0,a.jsxs)(t.li,{children:["\n",(0,a.jsx)(t.p,{children:"Performance documentation (benchmark results, capability evaluations)"}),"\n"]}),"\n",(0,a.jsxs)(t.li,{children:["\n",(0,a.jsx)(t.p,{children:"Impact assessment (societal effects, safety implications, ethical considerations)"}),"\n"]}),"\n",(0,a.jsxs)(t.li,{children:["\n",(0,a.jsx)(t.p,{children:"Deployment documentation (implementation strategies, monitoring plans)"}),"\n"]}),"\n"]}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.strong,{children:"Another method of regulatory visibility for AI is the Know Your Customer (KYC) system."})," KYC systems are already an established part of financial regulation, used to detect and prevent money laundering and terrorist financing. They have proven effective in their ability to identify high-risk actors before a transaction takes place. The same principle can be applied to compute access. As discussed in the compute governance section, frontier models require massive computational resources, often concentrated in a small number of hyperscale providers who serve as natural regulatory chokepoints. A KYC system for AI would enable governments to detect the development of potentially hazardous systems early, prevent covert model training, and implement export controls or licensing requirements with greater precision. Since this approach targets capability thresholds rather than use cases, it could serve as a preventative tool for risk management rather than a reactive one to deployment failures (",(0,a.jsx)(t.a,{href:"https://www.governance.ai/research-paper/oversight-for-frontier-ai-through-kyc-scheme-for-compute-providers",children:"Egan & Heim, 2023"}),"). However, implementing a KYC regime for compute involves several open questions. Providers would need clear legal mandates, technical criteria for client verification, and processes for escalating high-risk cases to authorities. Jurisdictional fragmentation is a challenge. Many developers rely on globally distributed compute services, and without international cooperation, KYC regimes risk being undercut by regulatory arbitrage. To be effective, a compute-based KYC system would need to align with other transparency mechanisms, such as model registries and incident reporting systems (",(0,a.jsx)(t.a,{href:"https://www.governance.ai/research-paper/oversight-for-frontier-ai-through-kyc-scheme-for-compute-providers",children:"Egan & Heim, 2023"}),")."]}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.strong,{children:"How can national policies support responsible information-sharing?"})," Responsible reporting of information is important for both self-regulation and government oversight. As we discussed in the corporate governance section, companies developing and deploying frontier AI systems have primary access to information about their systems' capabilities and potential risks, and sharing this information responsibly can significantly improve the state's ability to manage AI risks (",(0,a.jsx)(t.a,{href:"https://arxiv.org/abs/2404.02675",children:"Kolt et al., 2024"}),"). National policies must address the tension between transparency and proprietary control. One approach is tiered disclosure, in which technical documentation is provided to regulators under confidentiality agreements while public communication remains high-level and risk-focused. Another approach is through anonymized or aggregated sharing of data, which enables statistical insight without revealing sensitive implementation details."]}),"\n",(0,a.jsxs)(t.p,{children:["Although incident reporting systems from other industries, such as the confidential and non-punitive Aviation Safety Reporting System (ASRS) in the United States, offer useful precedents, no equivalent system yet exists for AI. In aviation, it is clear what constitutes an incident or near-miss, but with AI, the lines can be blurry. Adapting this model would require clear definitions of what constitutes an \u201cincident,\u201d with structured categories ranging from model misbehavior to societal harms. Current national efforts on this are fragmented. In the EU, the AI Act mandates reporting of \u201cserious incidents\u201d by high-risk and general-purpose AI developers. In China, the Cyberspace Administration is building a centralized infrastructure for real-time reporting of critical failures under cybersecurity law. In the United States, incident reporting remains sector-specific, with preliminary efforts underway in health and national security (",(0,a.jsx)(t.a,{href:"https://www.pourdemain.ngo/en/post/learning-from-history-gpai-serious-incident-reporting",children:"Farrell, 2024"}),"; ",(0,a.jsx)(t.a,{href:"https://www.convergenceanalysis.org/ai-regulatory-landscape/ai-incident-reporting",children:"Cheng, 2024"}),"; ",(0,a.jsx)(t.a,{href:"https://www.oecd.org/content/dam/oecd/en/publications/reports/2025/02/towards-a-common-reporting-framework-for-ai-incidents_8c488fdb/f326d4ac-en.pdf",children:"OECD, 2025"}),")."]}),"\n",(0,a.jsx)(t.h2,{id:"03",children:"Ensuring Compliance"}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.strong,{children:"What regulatory tools can ensure compliance with AI safety standards?"})," For high-risk AI systems, oversight mechanisms must go beyond voluntary standards or one-time evaluations. Many researchers have proposed licensing regimes that would mirror regulatory practices in sectors such as pharmaceuticals or nuclear energy. In these domains, operators must obtain and maintain licenses by demonstrating continuous compliance with strict safety and documentation requirements. Applied to frontier AI, this approach would involve formal approval processes before model deployment, periodic audits, and the ability for authorities to revoke licenses in cases of non-compliance (",(0,a.jsx)(t.a,{href:"https://www.researchgate.net/publication/385353725_Safety_cases_for_frontier_AI",children:"Buhl et al., 2024"}),"). A credible licensing framework would require developers to submit a structured safety case, which is a formal argument supported by evidence showing that a system meets safety thresholds for deployment. This could include threat modeling, red-teaming results, interpretability evaluations, and post-deployment monitoring plans. Safety cases provide a mechanism for both ex ante approval and for tracking whether safety claims continue to hold as systems evolve in deployment. ",(0,a.jsx)(n,{term:"embedding",definition:'{"definition":"A dense vector representation of discrete objects (like words or tokens) in a continuous vector space that captures semantic relationships.","source":"","aliases":["Embedding","word embedding","embeddings","vector representation","vector embeddings"]}',children:(0,a.jsx)(n,{term:"embedding",definition:'{"definition":"A dense vector representation of discrete objects (like words or tokens) in a continuous vector space that captures semantic relationships.","source":"","aliases":["Embedding","word embedding","embeddings","vector representation","vector embeddings"]}',children:"Embedding"})})," these requirements into the licensing process can help governments establish a continuous cycle of review, feedback, and technical verification (",(0,a.jsx)(t.a,{href:"https://www.researchgate.net/publication/385353725_Safety_cases_for_frontier_AI",children:"Buhl et al., 2024"}),")."]}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.strong,{children:"How would enforcement work in practice?"})," Licensing frameworks must be supported by agencies with the power to investigate violations, impose sanctions, and suspend development. National enforcement practices vary between horizontal governance (applying general rules across sectors) and vertical regimes (targeting specific domains like healthcare or finance) (",(0,a.jsx)(t.a,{href:"https://www.convergenceanalysis.org/ai-regulatory-landscape/home",children:"Cheng & McKernon, 2024"}),"). For example, the European Union\u2019s AI Act establishes enforcement authority through horizontal governance framework with the European AI Office, which can investigate, issue fines up to 3% of global annual turnover, and mandate corrective action, combined with mandatory incident reporting, systemic risk mitigation requirements, and a supporting Codes of Practice for GPAI models (",(0,a.jsx)(t.a,{href:"https://www.convergenceanalysis.org/ai-regulatory-landscape/home",children:"Cheng & McKernon, 2024"}),"). In contrast, China\u2019s Cyberspace Administration (CAC) exercises centralized enforcement powers under a vertical regulatory framework. While its approach prioritizes rapid intervention and censorship compliance, the CAC lacks transparent procedural checks and often relies on vague criteria for enforcement. In the United States, enforcement is fragmented. While export controls are strictly applied through agencies like the Department of Commerce, broader AI safety compliance has been delegated to individual agencies, with no national licensing authority. As a result, enforcement actions are often reactive and domain-specific, and rely on discretionary executive powers (",(0,a.jsx)(t.a,{href:"https://www.convergenceanalysis.org/ai-regulatory-landscape/home",children:"Cheng & McKernon, 2024"}),"). Striking the right balance between these approaches will depend on institutional capacity, developer incentives, and the pace of AI advancement. In some cases, using existing sectoral authorities may suffice. In others, new institutions will be required to handle general-purpose capabilities that fall outside traditional regulatory categories (",(0,a.jsx)(t.a,{href:"https://arxiv.org/abs/2307.04699",children:"Dafoe, 2023"}),")."]}),"\n",(0,a.jsx)(r.A,{src:"./img/bFY_Image_36.png",alt:"Enter image alt description",number:"30",label:"4.30",caption:"The flow from safety cases to enforcement."}),"\n",(0,a.jsx)(t.h2,{id:"04",children:"Limitations and Trade-Offs"}),"\n",(0,a.jsxs)(t.p,{children:["Every governance approach faces fundamental constraints that no amount of institutional design can fully overcome. Understanding these limitations helps set realistic expectations and identifies where innovation is most needed (",(0,a.jsx)(t.a,{href:"https://cdn.governance.ai/GovAI-Research-Agenda.pdf",children:"Dafoe, 2023"}),")."]}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.strong,{children:"Some risks resist technical solutions."})," Despite advances in interpretability and evaluation, we still cannot fully understand or predict AI behavior. Black box models make verification difficult. Emergent capabilities appear unexpectedly. The gap between our governance ambitions and technical capabilities are substantial (",(0,a.jsx)(t.a,{href:"https://www.researchgate.net/publication/382885035_Reasons_to_Doubt_the_Impact_of_AI_Risk_Evaluations#:~:text=Improved%20understanding%20may%20also%20not,opportunity%20costs%20for%20AI%20safety.",children:"Mukobi, 2024"}),"). Current safety techniques like RLHF and constitutional AI show promise for today's models but may fail catastrophically with more capable systems. We're building governance frameworks around safety approaches that might become obsolete. This fundamental uncertainty requires adaptive frameworks that can evolve with understanding (",(0,a.jsx)(t.a,{href:"https://arxiv.org/abs/2407.21792",children:"Ren et al., 2024"}),")."]}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.strong,{children:"Measurement challenges undermine accountability."})," We lack robust metrics for many safety-relevant properties. How do you measure a model's tendency toward deception? Its potential for autonomous improvement? Its resistance to misuse? Without reliable measurements, compliance becomes a matter of interpretation rather than verification (",(0,a.jsx)(t.a,{href:"https://www.aisnakeoil.com/p/ai-safety-is-not-a-model-property",children:"Narayan & Kapoor, 2024"}),'). The EU AI Act, for example, requires "systemic risk" assessments, but provides limited guidance on how to measure such risks quantitatively (',(0,a.jsx)(t.a,{href:"https://www.researchgate.net/publication/387399002_The_First_Global_AI_Treaty_Analyzing_the_Framework_Convention_on_Artificial_Intelligence_and_the_EU_AI_Act",children:"Cheng, 2024"}),")."]}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.strong,{children:"Expertise shortages create critical bottlenecks."})," The number of individuals who deeply understand both advanced AI systems and governance remains extremely limited, and this gap exists at every level from company safety teams and regulators to international bodies. A lack of interdisciplinary talent undermines efforts to anticipate and manage emerging risks (",(0,a.jsx)(t.a,{href:"https://arxiv.org/abs/1802.07228",children:"Brundage et al., 2018"}),"). Institutional capacity for technical evaluation and oversight is similarly weak in many jurisdictions (",(0,a.jsx)(t.a,{href:"https://arxiv.org/abs/2012.06505",children:"Cihon et al., 2021"}),"). Governments struggle to attract and retain the expertise needed to regulate powerful AI models, anc technically literate, governance-aware professionals may be the most serious constraint on effective AI governance (",(0,a.jsx)(t.a,{href:"https://cdn.governance.ai/GovAI-Research-Agenda.pdf",children:"Dafoe, 2023"}),"; ",(0,a.jsx)(t.a,{href:"https://cdn.governance.ai/Open_Problems_in_Technical_AI_Governance.pdf",children:"Reuel & Bucknall, 2024"}),"). Much of the existing talent is concentrated in a few dominant firms, limiting public-sector oversight and reinforcing asymmetries in governance capacity (",(0,a.jsx)(t.a,{href:"https://ainowinstitute.org/publications/research/ai-now-2025-landscape-report",children:"Brennan et al., 2025"}),")."]}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.strong,{children:"Coordination costs escalate faster than capabilities."})," Each additional stakeholder, requirement, and review process adds friction to AI development (",(0,a.jsx)(t.a,{href:"https://arxiv.org/abs/2212.08364",children:"Schuett, 2023"}),"). While some friction helps ensure safety, excessive bureaucracy can drive development to less responsible actors or underground entirely (",(0,a.jsx)(t.a,{href:"https://papers.ssrn.com/sol3/papers.cfm?abstract_id=5241351",children:"Zhang et al., 2025"}),"). Speed mismatches create fundamental governance gaps. AI capabilities advance in months while international agreements take years to negotiate (",(0,a.jsx)(t.a,{href:"https://arxiv.org/abs/2401.02843",children:"Grace et al., 2024"}),"). GPT-4's capabilities surprised experts in March 2023; by the time regulatory responses emerged in 2024, the technology had moved on to ",(0,a.jsx)(n,{term:"multimodal",definition:'{"definition":"Relating to AI systems that can process and understand multiple types of data (such as text, images, audio, video) simultaneously.","source":"","aliases":["Multimodal","multi-modal","multimodality"]}',children:(0,a.jsx)(n,{term:"multimodal",definition:'{"definition":"Relating to AI systems that can process and understand multiple types of data (such as text, images, audio, video) simultaneously.","source":"","aliases":["Multimodal","multi-modal","multimodality"]}',children:"multimodal"})})," systems and AI agents (",(0,a.jsx)(t.a,{href:"https://arxiv.org/abs/2307.15217",children:"Casper et al., 2024"}),"). Safety researchers emphasize precaution and worst-case scenarios, companies prioritize competitive position and time-to-market, governments balance multiple constituencies with conflicting demands, and users want beneficial capabilities without understanding risks (",(0,a.jsx)(t.a,{href:"https://cdn.governance.ai/GovAI-Research-Agenda.pdf",children:"Dafoe, 2023"}),")."]}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.strong,{children:"Regulatory arbitrage undermines safety standards across borders."})," If Europe implements strict safety requirements while other regions remain permissive, development may simply shift locations (",(0,a.jsx)(t.a,{href:"https://scholarship.law.georgetown.edu/facpub/2647/",children:"Lancieri et al., 2024"}),"). As we previously discussed in the proliferation section, the digital nature of AI makes it so that a model can be trained in Singapore, deployed from Ireland, and used globally (",(0,a.jsx)(t.a,{href:"https://arxiv.org/abs/2303.12642",children:"Seger et al., 2023"}),"). Companies may bifurcate offerings, providing safer systems to regulated markets while deploying riskier versions elsewhere. True global coverage requires more than powerful individual jurisdictions."]})]})}function p(e={}){const{wrapper:t}={...(0,s.R)(),...e.components};return t?(0,a.jsx)(t,{...e,children:(0,a.jsx)(h,{...e})}):h(e)}}}]);